import { useState } from "react"





function Gopi() {
    const [person] = useState({
        fname: "John",
        lname: "hjj",
        email: "john@gmail.com"
    });
    let [Students] = useState (["ram","vijay", "guna","kumar"])




    return <div>
        <li>{person.fname}</li>
        <li>{person.lname}</li>
        <li>{person.email}</li>  
        <ul>
            <li>ram</li>
            <li>kiran</li>
            <li>suma</li>
            <li>rahul</li>
        </ul>
        <ul>
            {Students.map(function(std){
                return <li>{std}</li>
            })
                
            }
        </ul>
    </div>
}
export default Gopi
